import React, { useState, useEffect } from 'react'

function App() {
    const [info, setInfo] = useState([])

    useEffect(() => {
        fetch('http://localhost:4000/doubleSpeak')
            .then((r)=>r.json())
            .then((stuff)=>setInfo(stuff))
    }, [])

    console.log(info)

    return(
        info.map(i=><h1 key={i.title} >{i.title}</h1>)
    )
}
export default App
